import {
    createBrowserRouter,
    RouterProvider,
  } from "react-router";

  import React from "react";
  import ReactDOM from "react-dom/client";
import Layout from "./Layout";

  const router = createBrowserRouter([
    {
      path: "/",
      element: <Layout/>,
    },
  ]);

//   const root = document.getElementById("root");

